    false,nt"url": null,nt"notes": "This shapefile represents mitigation areas
    included in the Vernal Pool Clean Water Act Permit Database, developed by AECOM
    for the Placer Land Trust. The permit database includes data obtained from files
    maintained by the U.S. Army Corps of Engineers (USACE) Sacramento District Office,
    relating to permits issued under the authority of Section 404 of the Clean Water
    Act, that allow adverse effects on vernal pools. Permits for activities that likely
    impacted vernal pools and were issued between the years 2000 and 2005 were obtained
    from the USACE by Placer Land Trust through Freedom of Information Act (FOIA) requests.
    The data were compiled to develop an understanding of cumulative impacts of permitted
    losses of vernal pools in the Central Valley of California.",nt"owner_org":
